import React from 'react';
import './ComponenteInicio.css';
import {Card, Container} from 'react-bootstrap';

const ComponenteInicio = () => {
    return (
      <Card className="text-white" class='componenteInicio'>
         <Card.Img src='https://assets.ey.com/content/dam/ey-sites/ey-com/en_us/topics/real-estate-hospitality-and-construction/ey-high-angle-of-buildings.jpg' alt="edificios" />
         <Card.ImgOverlay>
         <Card.Title>Encontr√° tu lugar</Card.Title>
         <Card.Text>
             This is a wider card with supporting text below as a natural lead-in to
             additional content. This content is a little bit longer.
         </Card.Text>
         <Card.Text>Last updated 3 mins ago</Card.Text>
         </Card.ImgOverlay>
      </Card>
  );
}

export default ComponenteInicio;

